import "./App.css";
import { useState, useEffect } from "react";
import { Routes, Route, Link, useNavigate, Outlet } from "react-router-dom";
import Navbar from "./Navbar";
import HiddenBar from "./HiddenBar";

function App() {
  return (
    <div className="App">
      <Route>
        <Navbar />
        <HiddenBar />
      </Route>
    </div>
  );
}

export default App;
